import React,{useState} from 'react';
import NavBar from "./NavBar.jsx";
import Axios from "axios";


function Edit(){

  const [Name,setResName] = useState("");
  const [Location,setResLocation] = useState("");
  const [Img,setResImg] = useState("");
  const [Description,setResDescription] = useState("");
  const [Contact,setResContact] = useState("");
  const [Timings,setResTimings] = useState("");

  function submitChanges() {
      Axios.put("http://localhost:3001/RestaurantLanding.jsx",
        {
          Name:resName,
          Location:resLocation,
          Img:resImg,
          Description:resDescription,
          Contact:resContact,
          Timings:resTimings
        }).then((response) => {
            console.log(response)
            console.log("Edit changes made")
          })
        }

  function showInput() {
      document.getElementById('name').innerHTML = document.getElementById("res_name").value;
      document.getElementById('location').innerHTML = document.getElementById("res_location").value;
      document.getElementById('description').innerHTML = document.getElementById("res_description").value;
      document.getElementById('contact').innerHTML = document.getElementById("res_contact").value;
      document.getElementById('timings').innerHTML = document.getElementById("res_timings").value;
    }

  return(
    <div className="card">
    <NavBar />
    <div className="card-body">
    <input
     id="res_name"
     type="text"
     name="resName"
     placeholder="Restaurant Name"
     defaultValue={JSON.parse(localStorage.getItem("user"))[0]["restaurantName"]}
     onChange = {
       (e) => {
         setResName(e.target.value);
       }
     }
    />

    </div>
    <div className="card-body">
    <input
    id="res_location"
     type="text"
    className = "form-control"
     name="resLocation"
     placeholder="Restaurant Location"
     defaultValue={JSON.parse(localStorage.getItem("user"))[0]["location"]}
     onChange = {
       (e) => {
         setResLocation(e.target.value);
       }
     }
    />
    </div>
    <div className="card-body file">
    <input
    id="res_img"
    type="file"
   className = "form-control"
    name="resImg"
    onChange= { e => {
      setResImg(e.target.value);
    }}
    />
    </div>
    <div className="card-body">
    <input
    id="res_description"
    type="text"
    className = "form-control"
    name="resDescription"
    placeholder="Restaurant Description"
    onChange= { e => {
      setResDescription(e.target.value);
    }}
    />
    </div>
    <div className="card-body">
    <input
    id="res_contact"
    type="text"
      className = "form-control"
    name="resContact"
    placeholder="Restaurant Contact"
    onChange= { e => {
      setResContact(e.target.value);
    }}
    />
    </div>
    <div className="card-body">
    <input
    id="res_timings"
    type="text"
      className = "form-control"
    name="resTimings"
    placeholder="Restaurant Timings"
    onChange= { e => {
      setResTimings(e.target.value);
    }}
    />
    </div>
    <button type="button" class="btn btn-outline-light" onClick={submitChanges}>Save Changes</button>
    <button type="button" class="btn btn-outline-light" onClick={showInput}>Show Details</button>
    <center>
    <div className="container-fluid">
    <p><span id="name"></span></p>
    <p><span id="location"></span></p>
    <p><span id="image"></span></p>
    <p><span id="description"></span></p>
    <p><span id="contact"></span></p>
    <p><span id="timings"></span></p>
  </div>
  </center>
  </div>


  );

}

export default Edit;
